/*
 * lang = '0' --> is "EN" or "TH" language
 * lang = '1' --> is "EN" language only
 * lang = '2' --> is "TH" language only
 * lang = '3' --> is "EN" and Number
 * lang = '4' --> is "TH" and Number
 * num = 'yes' --> is "0-9"
 * special = '1' --> is space
 * special = '2' --> is space, "/", "-", ".", "(", ")"
 * special = '3' --> is "/", "-", "@", "_", "." (email)
 * special = '4' --> is "*"
 */

function validateText(value, lang, num, special){
    if(value == null || value == ''){
        return false;
    }

    for(var i=0;i<value.length;i++){
        var ch = value.charCodeAt(i);

        /*check lang*/
        var flagLang = true;
        if(lang == null || lang == ''){ //default
            flagLang = false;

        }else if(lang == '0') {
            if(!isEngLang(ch) && !isThaiLang(ch)){
                flagLang = false;
            }

        }else if(lang == '1') {
            if(!isEngLang(ch)){
                flagLang = false;
            }

        }else if(lang == '2') {
            if(!isThaiLang(ch)){
                flagLang = false;
            }
        }else if(lang == '3') {
            if(!isEngLang(ch) && !isNumber(ch)){
                flagLang = false;
            }
        }else if(lang == '4') {
            if(!isThaiLang(ch) && !isNumber(ch)){
                flagLang = false;
            }
        }else{
            flagLang = false;
        }
        if(flagLang) continue;

        /*check num*/
        var flagNum = true;
        if(num == null || num == ''){
            flagNum = false;

        }else if(num == 'yes'){
            if(!isNumber(ch)){
                flagNum = false;
            }

        }else{
            flagNum = false;
        }
        if(flagNum) continue;

        /*check special*/
        var flagSpecial = true;
        if(special == null || special == ''){
            flagSpecial = false;

        }else if(special == '1'){
            if(ch != 32){ //space
                flagSpecial = false;
            }

        }else if(special == '2'){
            if(!isSpecial(ch)){
                flagSpecial = false;
            }

        }else if(special == '3'){
            if(!isEmail(ch)){
                flagSpecial = false;
            }

        }else if(special == '4'){
            if(!star(ch)){
                flagSpecial = false;
            }

        }else{
            flagSpecial = false;
        }

        if(!flagNum && !flagSpecial){
            return false;
        }
    }
    return true;
}

function isThaiLang(ch){
    if (ch >= 3585 && ch <= 3675){
        return true;
    }else{
        return false;
    }
}

function isEngLang(ch){
    if ((ch >= 65 && ch <= 90) //a-z
        || (ch >= 97 && ch <= 122)){ //A-Z
        return true;
    }else{
        return false;
    }
}

function isNumber(ch){
    if (ch >= 48 && ch <= 57){ //0-9
        return true;
    }else{
        return false;
    }
}

function isSpecial(ch){
    if(ch != 32 && ch != 40 && ch != 41 && ch != 44 && ch != 45 && ch != 46 && ch != 47){ // space, "/", "-", "."
        return false;
    }else{
        return true;
    }
}

function isEmail(ch){
    if(ch != 45 && ch != 46  // "/", "-", "."
        && ch != 64 && ch != 95 ){   // "@", "_"
        return false;
    }else{
        return true;
    }
}

function star(ch){
    if(ch != 35 && ch != 42){   // "#","*"
        return false;
    }else{
        return true;
    }
}
